<?php declare(strict_types = 1);

$input = '';

function split(string $chars): string {
    $chars = str_split($chars);
    $splitting = true;

    while ($splitting === true) {
        $splitting = false;
        foreach ($chars as $key => &$char) {
            $next = $chars[$key + 1];
            if (((ctype_upper($char) && ctype_lower($next))
                    ||(ctype_lower($char) && ctype_upper($next)))
                && strtoupper($char) === strtoupper($next)
            ) {
                unset($chars[$key], $chars[$key + 1]);
                $splitting = true;
            }
        }
        $chars = str_split(implode('', $chars));
    }

    return implode('', $chars);
}

$result = split($input);
$bestCount = strlen($result);
foreach (range('A', 'Z') as $char) {
    $improved = str_replace($char, '', $result);
    $improved = str_replace(strtolower($char), '', $improved);
    $improved = split($improved);
    if (strlen($improved) < $bestCount) {
        $bestCount = strlen($improved);
    }
}

echo $bestCount;